"use strict";
// I recommend using quick version because slow one is REALLY slow.
player.onChat("build-castle-quick", function () {
    blueprint = cachedBlueprint;
    buildCastle();
});
player.onChat("build-castle-slow", function () {
    sketchCastle();
    buildCastle();
});
function buildCastle() {
    builder.teleportTo(pos(0, 0, 1));
    builder.move(LEFT, 35);
    builder.move(BACK, 15);
    builder.move(DOWN, 2);
    for (let z = 0; z < Z; z++) {
        for (let y = 0; y < Y; y++) {
            builder.move(FORWARD, X);
            for (let x = 0; x < X; x++) {
                builder.move(BACK, 1);
                let id = getElement(z, x, y);
                if (id == 0)
                    continue;
                else
                    builder.place(blocks.blockById(getElement(z, x, y)));
            }
            builder.move(RIGHT, 1);
        }
        builder.move(UP, 1);
        builder.move(LEFT, Y);
    }
}
const X = 29, Y = 29, Z = 20;
const XY = X * Y;
const XYZ = X * Y * Z;
let blueprint;
function initBlueprint() {
    blueprint = [];
    for (let i = 0; i < XYZ; i++)
        blueprint.push(0);
}
function getElement(layer = 0, x = 0, y = 0) {
    return blueprint[layer * XY + y * X + x];
}
function setElement(layer = 0, x = 0, y = 0, block = 0) {
    blueprint[layer * XY + y * X + x] = block;
}
function sketchCube(startAtLayer = 0, startAtX = 0, startAtY = 0, height = 0, lengthX = 0, lengthY = 0, block = 0) {
    for (let layer = startAtLayer; layer < startAtLayer + height; layer++)
        for (let y = startAtY; y < startAtY + lengthY; y++)
            for (let x = startAtX; x < startAtX + lengthX; x++)
                setElement(layer, x, y, block);
}
function sketchCastle() {
    initBlueprint();
    sketchCube(0, 0, 0, 2, X, Y, WATER); // MOAT
    sketchCube(0, 5, 5, 2, 19, 19, COBBLESTONE); // FOUNDATION
    sketchWalls(2, 5, 5, 12, 19, 19, 2, STONE_BRICKS); // OUTER WALLS
    sketchCube(2, 7, 7, 1, 15, 15, STONE_SLAB); // GROUND FLOOR
    sketchCube(7, 7, 7, 1, 15, 15, PLANKS_OAK); // 1ST FLOOR
    sketchCube(13, 5, 5, 1, 19, 19, PLANKS_OAK); // 2ND FLOOR
    sketchCube(2, 13, 13, 12, 3, 3, AIR); // SKYLIGHT
    sketchCube(1, 13, 13, 1, 3, 3, GRASS); // GRASS
    sketchWalls(2, 12, 12, 12, 5, 5, 1, STONE_BRICKS); // INNER WALLS
    sketchWalls(13, 4, 4, 1, 21, 21, 1, STONE_BRICKS); // OUTER RAILING EDGE
    sketchWalls(14, 4, 4, 1, 21, 21, 1, COBBLESTONE_WALL); // OUTER RAILING
    sketchWalls(14, 12, 12, 1, 5, 5, 1, COBBLESTONE_WALL); // INNER RAILING
    sketchTower(3, 3, 15, 4, 4); // TOWER NORTH-WEST
    sketchTower(22, 3, 15, 4, 4); // TOWER NORTH-EAST
    sketchTower(3, 22, 15, 4, 4); // TOWER SOUTH-WEST
    sketchTower(22, 22, 15, 4, 4); // TOWER SOUTH-EAST
    [3, 9].forEach(layer => {
        [9, 14, 19].forEach(offsetA => {
            sketchWindows(layer, offsetA); // WINDOWS (HOLES)
            [5, 23].forEach(offsetB => {
                sketchGlass(layer, offsetA, offsetB); // WINDOWS (GLASS)
            });
        });
    });
    sketchGate();
    sketchStairs(7, 8, 11, 6, 2); // STAIRS GROUND FLOOR -> 1ST FLOOR
    sketchStairs(13, 19, 11, 6, 2); // STAIRS 1ST FLOOR -> 2ND FLOOR
    setElement(15, 12, 12, TORCH); // TORCH ROOF NW
    setElement(15, 16, 12, TORCH); // TORCH ROOF NE
    setElement(15, 12, 16, TORCH); // TORCH ROOF SW
    setElement(15, 16, 16, TORCH); // TORCH ROOF SE
    setElement(2, 14, 14, TORCH); // TORCH GROUND FLOOR
}
function sketchWalls(startAtLayer = 0, startAtX = 0, startAtY = 0, height = 0, lengthX = 0, lengthY = 0, thickness = 0, block = 0) {
    sketchCube(startAtLayer, startAtX, startAtY, height, thickness, lengthY, block); // WALL WEST
    sketchCube(startAtLayer, startAtX, startAtY, height, lengthX, thickness, block); // WALL NORTH
    sketchCube(startAtLayer, startAtX + lengthX - thickness, startAtY, height, thickness, lengthY, block); // WALL EAST
    sketchCube(startAtLayer, startAtX, startAtY + lengthY - thickness, height, lengthX, thickness, block); // WALL SOUTH
}
function sketchTower(startAtX = 0, startAtY = 0, height = 0, lengthX = 0, lengthY = 0) {
    sketchCube(0, startAtX, startAtY, 2, lengthX, lengthY, COBBLESTONE); // FOUNDATION
    sketchCube(2, startAtX, startAtY, height, lengthX, lengthY, STONE_BRICKS); // WALLS
    sketchCube(2 + height, startAtX, startAtY, 1, lengthX, lengthY, PLANKS_OAK); // FLOOR
    sketchWalls(2 + height, startAtX - 1, startAtY - 1, 1, lengthX + 2, lengthY + 2, 1, STONE_BRICKS); // RAILING EDGE
    sketchWalls(3 + height, startAtX - 1, startAtY - 1, 1, lengthX + 2, lengthY + 2, 1, COBBLESTONE_WALL); // RAILING
    setElement(4 + height, startAtX - 1, startAtY - 1, TORCH); // TORCH NW
    setElement(4 + height, startAtX + lengthX, startAtY - 1, TORCH); // TORCH NE
    setElement(4 + height, startAtX - 1, startAtY + lengthY, TORCH); // TORCH SW
    setElement(4 + height, startAtX + lengthX, startAtY + lengthY, TORCH); // TORCH SE
}
function sketchGate() {
    sketchCube(0, 12, 24, 2, 5, 1, COBBLESTONE); // FOUNDATION
    sketchCube(2, 12, 24, 5, 5, 1, STONE_BRICKS); // FRAME
    sketchCube(2, 13, 22, 4, 3, 3, AIR); // ENTRANCE
    sketchCube(2, 13, 22, 1, 3, 7, OAK_WOOD_SLAB); // BRIDGE
    setElement(7, 12, 24, TORCH); // TORCH LEFT
    setElement(7, 16, 24, TORCH); // TORCH RIGHT
}
function sketchWindows(startAtLayer = 0, offset = 0) {
    sketchCube(startAtLayer, offset, 5, 3, 1, 19, AIR); // WINDOW NORTH-SOUTH
    sketchCube(startAtLayer, 5, offset, 3, 19, 1, AIR); // WINDOW EAST-WEST
}
function sketchGlass(startAtLayer = 0, offsetA = 0, offsetB = 0) {
    sketchCube(startAtLayer, offsetA, offsetB, 3, 1, 1, GLASS_PANE); // GLASS NORTH-SOUTH
    sketchCube(startAtLayer, offsetB, offsetA, 3, 1, 1, GLASS_PANE); // GLASS EAST-WEST
}
function sketchStairs(startAtLayer = 0, startAtX = 0, startAtY = 0, height = 0, width = 0) {
    sketchCube(startAtLayer, startAtX, startAtY + 2, 1, 2, 4, AIR); // STAIRS CUTOUT
    let y = startAtY + height;
    for (let layer = startAtLayer; layer > startAtLayer - height; layer--) {
        for (let x = startAtX; x < startAtX + width; x++)
            setElement(layer, x, y, OAK_WOOD_STAIRS);
        y--;
    }
}
